import React from 'react';
import './css/About.css';
import lonelyfox from './static/avatar.png';
import Box from '@material-ui/core/Box';
import AppBar from '@material-ui/core/AppBar'
import {Link} from 'react-router-dom';
import Avatar from '@material-ui/core/Avatar';
import {withStyles, createStyles} from '@material-ui/styles';
import StyledProps from './StyledProps';

const Navigation = (props: StyledProps) => {
  const classes = props.classes;
  return (   
      <AppBar className={classes.navBar}>
            <Avatar alt="Lonely Fox" src={lonelyfox} className={classes.avatar}></Avatar>
            <Link to ="/" className={classes.title}>
                Nathanael Shim
            </Link>
          <Box display={{xs: 'grid', md: 'flex', lg: 'flex'}}>
              <Link to= "/" className={classes.text}> About </Link>
              <Link to= "/projects" className={classes.text}> Projects </Link>        
              <Link to= "/devlog" className={classes.text}>Blog</Link>
          </Box>
      </AppBar>
  );
}

const useStyles = createStyles({
  navBar: {
    display: 'flex',
    alignItems: 'center',
    padding: '2rem',
    backgroundColor: '#F7F3F2',
  },
  logoContainer: {
    backgroundColor: '#F7F3F2',
    flexGrow: 1,
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },
  text: {
    fontFamily: 'Montserrat',
    color: '#12130F',
    fontSize: '1.5rem',
    padding: '1rem',
    textDecorationColor: '#F7F3F2',
    '&:hover': {
      textDecoration: 'underline',
      textDecorationColor: '#FEB954',
      transitionDuration: '.3s',
    }
  },
  title: {
    fontFamily: 'Montserrat',
    color: '#12130F',
    fontSize: '1.5rem',
    marginBlock:'2rem',
    paddingTop:'2rem',
    paddingLeft:'1rem',
    textDecoration: 'none',
    textDecorationColor: '#F7F3F2',
    '&:hover': {
      textDecoration: 'underline',
      textDecorationColor: '#FEB954',
      transitionDuration: '.3s',
    }
  },
  avatar: {
    fontSize: '1rem',
    width: '100px',
    height: '100px',
  },
});

export default withStyles(useStyles)(Navigation);
